import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Header.css'; // Importando o CSS

const Header = () => {
  const navigate = useNavigate();

  const handleHomeClick = () => {
    navigate('/home');
  };

  const handleButtonClick = (route) => {
    navigate(route);
  };

  const buttonData = [
    { label: 'luminosa', route: '/luminosa' },
    { label: 'astoria', route: '/astoria' },
    { label: 'serenata', route: '/serenata' },
    { label: 'bravura', route: '/bravura' },
    { label: 'marítima', route: '/maritima' },
    { label: 'veloz', route: '/veloz' },
  ];

  return (
    <header className="header">
      <div className="left-section">
        <img
          src="URL_DA_SUA_IMAGEM" // Substitua pela URL da sua imagem
          alt="Home"
          className="logo"
          onClick={handleHomeClick}
        />
      </div>
      <div className="right-section">
        {buttonData.map((button, index) => (
          <button
            key={index}
            className="button"
            onClick={() => handleButtonClick(button.route)}
          >
            {button.label}
          </button>
        ))}
      </div>
    </header>
  );
};

export default Header;
